import React from 'react'; 
import {Link} from 'react-router-dom';
import Twitter from '../img/twitter.png';

function Footer() {

    const footStyle = {
        color: 'white'
      };

    return (
      <div className='footer'>

        <ul className="nav-links">

        <Link style={ footStyle } to='/'>
          <li> D || A </li>
        </Link>

        <Link style={ footStyle } to={{ pathname: "https://twitter.com/david_zealot" }} target="_blank" >
          <li> 
            <a href="https://twitter.com/david_zealot">
                <img src={ Twitter } alt="twitterLogo"></img>
            </a>
          </li>
        </Link>

        <Link style={ footStyle } to={{ pathname: "https://twitter.com/david_zealot" }} target="_blank" >
          <li> 
            <a href="https://twitter.com/david_zealot">
                <img src={ Twitter } alt="twitterLogo"></img>
            </a>
          </li>
        </Link>

      </ul>
      </div>
    );
  }

  export default Footer;
